# Safe accessor for pokemon names
def pokemon_name(pokemon_id: int) -> str:
    if 0 <= pokemon_id < len(POKEMON_NAMES):
        return POKEMON_NAMES[pokemon_id]
    return f"pokemon_{pokemon_id}"  # fallback
